import{_ as t,c as o,o as n,ah as r}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"J&TEXPRESS SHIPPING","description":"J&TEXPRESS SHIPPING","frontmatter":{"title":"J&TEXPRESS SHIPPING","description":"J&TEXPRESS SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/j&texpress-shipping.md","filePath":"zenith/featured-app/shipping/j&texpress-shipping.md"}'),a={name:"zenith/featured-app/shipping/j&texpress-shipping.md"};function p(i,e,s,l,h,g){return n(),o("div",null,[...e[0]||(e[0]=[r('<p>The <a href="/zenith/introduction/">Multi-vendor Marketplace</a> has come up with yet another shipping feature app named <strong>J&amp;T Express.</strong></p><p><a href="https://www.jtexpress.my/track.php" target="_blank" rel="noreferrer">J&amp;T Express</a> is known to be an integrated logistics service that allows sellers to ship the package(s) using their own packaging and deliver the items to the customers.</p><p>By enabling this featured app, the admin can allow sellers to manage the order fulfillment via J&amp;T Express and automatically generate shipping labels of the orders.</p><p>This feature app will charge you a minimal amount of <strong>$10 per month</strong> over and above your current Multivendor plan.</p><p>NOTE:- This J&amp;T Express shipping feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month).</p><p>Moreover, you need to enable the <strong><a href="/zenith/featured-app/overview.html">Shipping</a></strong> Add-on for FREE from the ‘Feature Apps’ section of the app.</p><p>Also, Access to Shipping requires your Shopify store to be on the plan that supports <a href="https://help.shopify.com/en/manual/shipping/setting-up-and-managing-your-shipping/enabling-shipping-carriers" target="_blank" rel="noreferrer"><strong>Real-Time Carrier-Calculated Shipping</strong>.</a></p><p><strong>NOTE:- The featured app is available only for Singapore shipments.</strong></p><p>J&amp;T EXPRESS SHIPPING FEATURE APP IS AVAILABLE <strong>ONLY FOR FULFILLMENT</strong>.</p><h3 id="how-to-activate-j-t-express-shipping" tabindex="-1">How to Activate J&amp;T Express Shipping? <a class="header-anchor" href="#how-to-activate-j-t-express-shipping" aria-label="Permalink to &quot;How to Activate J&amp;T Express Shipping?&quot;">​</a></h3><p>To enable the feature app, all you need to do is to visit the “<strong>Featured Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Home-Admin-1-1200x627.png" alt="Feature App-shipping"></p><p>Once you click on “Feature Apps”, you will get the list of apps listing in this section. There, You will get the <strong>J&amp;T Express</strong> feature. You just need to click the <strong>enable</strong> button.</p><p>In this way, you can enable the feature within your Multivendor App.</p><h3 id="workflow" tabindex="-1">Workflow <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;Workflow&quot;">​</a></h3><p><strong>ADMIN END</strong><br> Once you enable this feature app, a new sub-menu gets added in the Configuration menu of the app i.e. <strong>J&amp;T Express Configuration</strong>.</p><p>Note:- You need to have an account on J&amp;T Express to configure the details in the app.</p><p>Before this, You need to visit the Shipping Configuration and <strong>enable the J&amp;T Express Shipping</strong> as shown in the below screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Configuration-Admin-1-1200x597.png" alt="Configuration-Admin-1"></p><p>Once you activate the J&amp;T Express Shipping, you can proceed to configure the J&amp;T Express Shipping details. Go to Configuration&gt;&gt;<strong>J&amp;T Express Configuration</strong>.</p><p>To get these details configured in the app, you need to have an account in the J&amp;T Express. <a href="https://www.jtexpress.sg/create-an-account" target="_blank" rel="noreferrer">Register to J&amp;T Express!</a></p><p>So, you need to enter the J&amp;T Express Username &amp; Password in the configuration.<br><strong>MARK</strong>:- The password you enter here will be the <strong>API password</strong>.</p><p>In case you want to manage the shipment internationally, you need to enable &quot;International Shipping&quot;.</p><p>Moreover, to allow sellers to generate the shipping labels automatically on fulfilled orders, you need to enable the tab in the configuration menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/JTExpress-Configuration-Admin-1133x1024.png" alt="JTExpress-Configuration-Admin"></p><h4 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h4><p>To use this feature add-on, the admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>To do this, You need to go to Shopify Backend &gt; Settings &gt; Checkout &gt; Under Form Options, make Shipping address phone number as <strong>Required</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="J&amp;T Express Shipping"></p><p><strong>SELLER PANEL</strong></p><p>Once you configure these details, the sellers will also get the option to enable the J&amp;T Express shipping from the <strong>Shipping Configuration</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Shipping-Configuration-Seller-J&amp;T Express"></p><p>Moreover, the sellers need to configure the Global Shipping Configuration details from here:</p><p>Domestic Delivery Method:- The seller needs to select the delivery method such as Domestic Normal, Domestic Express, Domestic 1-3 Days as per the requirement.</p><p>International Delivery Method:- One default delivery method in case the seller manages to ship internationally.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1200x597.png" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-1"></p><p>Now, the seller can fulfill orders via the J&amp;T Express shipping courier service.</p><h3 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h3><p>Both admin and seller can generate the shipping label for the fulfilled orders. Admin can configure the shipping Label details from his admin panel.</p><p>Seller needs to follow the below-given steps to generate shipping labels for fulfilled orders:</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>Go to <strong>Orders</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li><li>Select the <strong>Order</strong> for which You want to <strong>Generate Shipping Label.</strong></li><li>Proceed to fulfill the order.</li></ul><p>Clicking the Fulfill button, you need to select the <strong>J&amp;T Express</strong> as the shipping method.</p><p>Thus, the shipping label will be generated automatically for the fulfilled orders. Thus, the seller can easily print the shipping label from here:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/08/A6.png" alt="A6"></p><p>Shipping Label via J&amp;T Express</p><h2 id="demo" tabindex="-1">DEMO <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;DEMO&quot;">​</a></h2><p>Link to check the demo of Multi-vendor Marketplace app for Shopify: <a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',48)])])}const c=t(a,[["render",p]]);export{u as __pageData,c as default};
